import ListGroup from 'react-bootstrap/ListGroup';

function HeaderLinks() {
    const items = [
        'Projects',
        'Education',
        'Who Am I'
    ];
  return (
    <ListGroup>
      {items.map(item => <li>{item}</li>)}
    </ListGroup>
  );
}

export default HeaderLinks;
